import unittest
import KVDB.kvdb
import time
from threading import Thread


class bcolors:
    HEADER = '\033[95m'
    OKBLUE = '\033[94m'
    OKCYAN = '\033[96m'
    OKGREEN = '\033[92m'
    WARNING = '\033[93m'
    FAIL = '\033[91m'
    ENDC = '\033[0m'
    BOLD = '\033[1m'
    UNDERLINE = '\033[4m'


db = KVDB.kvdb.KVDB("F:\\Python")  # Give your path


class SimpleTest(unittest.TestCase):
    def testInsert(self):
        self.assertEqual(db.set(
            "1", '{ "name":"John" }'), print(bcolors.OKGREEN + "Inserted Successfully!" + bcolors.ENDC))

    def testRead(self):
        self.assertEqual(db.get(
            "1"), print({"value": {"name": "John"}, "Time-To-Live": int(round(time.time()
                                                                              * 1000 * 60 * 60 * 24))}))

    def testDelete(self):
        try:
            self.assertEqual(db.remove(
                "1"), print(bcolors.OKGREEN + "Deleted Successfully!" + bcolors.ENDC))
        except:
            with self.assertRaises(KVDB.kvdb.KeyExistError):
                self.assertEqual(db.remove(
                    "1"), print(bcolors.OKGREEN + "Deleted Successfully!" + bcolors.ENDC))

    def testWithInvalidKey(self):
        with self.assertRaises(KVDB.kvdb.KeySizeError):
            db.set(
                "127346087394-0237486973280967498709128096347", '{ "name":"John" }')

    def testWithInvalidValueType(self):
        with self.assertRaises(KVDB.kvdb.InvalidValueType):
            db.set(
                "127346087394", 'Hello World')

    def testRetrievingInvalidKey(self):
        with self.assertRaises(KVDB.kvdb.KeyNotExistError):
            db.get(
                "12")

    def testRemovingWithInvalidKey(self):
        with self.assertRaises(KVDB.kvdb.KeyNotExistError):
            db.get(
                "12")

